VertexText.data:
attribute vec2 vpos;
attribute vec2 uv0;
attribute vec4 color;

varying vec4 frag_color;
varying vec2 texcoord0;

uniform mat4 proj;

void main(void)
{
        frag_color = color;
        texcoord0 = uv0;
        gl_Position = proj * vec4(vpos.x, vpos.y, 0, 1);
}

FragmentText.data:
varying vec4 frag_color;
varying vec2 texcoord0;
uniform sampler2D texture;

void main(void)
{
        vec4 tex = texture2D(texture, texcoord0);
        gl_FragColor = tex * vec4(1,1,1,1) * frag_color;
}
